import React, { Component } from 'react'
import {NavLink} from 'react-router-dom'

export class Navigation extends Component {
    render() {
        return (
            <ul>
                <li><NavLink className = 'link' exact to = '/Projects'>Projects</NavLink></li>
            </ul>
        )
    }
}

export default Navigation
